import React from 'react';

function Video() {
  return (
    <div className="App">

      <main className="container">
        <div className="grid">

            <iframe 
              width='100%'
              src="https://www.youtube.com/embed/OEGKAGPtqFg" 
              title="YouTube video player" 
              frameBorder="0" 
              allowFullScreen>
            </iframe>
        </div>
      </main>

    </div>
  );
}

export default Video;
